I have a different printer than the original author, and Slicer was having problems with a few of the parts.  I've taken those parts and run them through NetFabb.  Now, the helmet and shoulders slice without issue. 
Edit:  I uploaded the upper and lower torso as they would slice sometimes, but not others.  After sending them through the repair service, they seem to more easily slice.  I've found you need to use less supports if you print the lower torso upside down (with the connector facing the print bed), and the upper torso right side up (instead of laying down).
@rbuckbailey - if you end up incorporating these into your main thingiverse, I'll take this down to avoid confusion for people.

This is an attempt to improve dual extruder printing.<br />
I added a servo to swing the extruder 10 degree. This allow the unused extruder to be lifted 1-2 mm of the bed. 
I used this on my CoreXY printer <a rel="nofollow" href="http://www.thingiverse.com/thing:1183198" >http://www.thingiverse.com/thing:1183198</a> 
I use a small MG90S server to move the extruders.<br />
Running on RAMPS 1.4 Marlin code (testing on older 1.0. and latest 1.1.0-RC3)<br />
servo is connected on port 11 (servo 0 standard port)
The standard M280 Px Sy would move the servo fine but it is near to impossible to have the slicer to change tool automatically (I use Slic3r or Simplify3D)  . therefore I added a Custom G-code M801 to do that.<br />
The command moves the servo to P or S position (in mS) based on T value (0 or 1) . so T0 = use P value T1 = Use S value.
Examples:
M801 P50 S100 T0   (this move to mS 50 )<br />
M801 P50 S100 T1   (this move to mS 100 )
&lt;Slic3r configuration example. In printer setting, Custom G-Code add in Toll change G-Code&gt;
M801 P50 S100 T[next_extruder]
Similar in Simplify3D, (change next_extruder wiht new_tool)
M801 P50 S100 T[new_tool]
For Marlin 1.1 and above
Marlin_main.cpp

<li >M801 - CUSTOM : move servo to S or P position (in mS) based on T T0= use P value T1 = Use S value  exampl M801 P50 S100 T0. this allows me to change postion of extruder on tool change on normal slider</li>

// ---------------------------------------------------------------------------------------------------------------------------------------------<br />
// Alisi Custom M801 Code starts here    // M801 - Custom Code - set servo position based on T (0 or 1) P = T0 and Pabsolute. S = T1 alwais Server 0 , S: angle or microseconds
<code >inline void gcode_M801() { 

    int servo_index = 0;
    int servo_position[2] = {0,0} ;
    int servo_position_tool = -1;  // will hold the T value 0 or 1 

   servo_position[0] = code_seen('P') ? code_value_short() : -1;
   servo_position[1] = code_seen('S') ? code_value_short() : -1;
   servo_position_tool = code_seen('T') ? code_value_short() : -1;

   if (servo_position_tool &gt;= 0) {
          servo[servo_index].move(servo_position[servo_position_tool]);

      }
      else {
        SERIAL_ECHO_START;
        SERIAL_ECHO("Servo ");
        SERIAL_ECHO(servo_position_tool);
        SERIAL_ECHOLN(" out of range");
      }
  }</code>
